import React from 'react';
import ReactDOM from 'react-dom';

import * as serviceWorker from './serviceWorker';
import './index.css';
import { Posts } from './pages';

ReactDOM.render(<Posts />, document.getElementById('root'));
serviceWorker.unregister();
